INSERT INTO `comment` VALUES (3,1427407024,'978-7-5442-5897-5','2016-06-13 18:23:04','<p>和古往今来所有最伟大的爱情颂歌一样，马尔克斯笔下的爱情具有永恒的意义。但是这种意义也是理想中的意义，它要和现实，和喀他赫纳的世界拼死对抗才能保护自己。             自从有了人类，有了爱情，残忍、偏狭、愚昧、背叛，和永无休止的琐碎就缠绕着它，就象缠绕着人类其他的最美最高贵的造物。杜拉斯借他的人物说，“相比你年轻时的美丽，我更爱你历尽沧桑的容颜。”</p> 无忧无虑的青春，它不知道那朵幸福的五瓣丁香，需要一生去寻找，去追逐，去浇灌，去呵护，从年轻到年老，永不能休止，永不能停息。因为，“世界上再没有比爱更艰难的事了。” ',0,'2016-06-13 18:39:36'),(4,1427407024,'978-7-101-09645-3','2016-06-13 21:51:36','臨江仙·夜登小閣億洛中舊游  宋 ·陳與義  憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明  二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更',1,'2016-06-13 21:51:41'),(12,1427407024,'978-7-5317-3115-3','2016-06-03 12:02:38','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更</p>',0,NULL),(13,1427407025,'978-7-5442-5897-5','2016-06-03 12:14:00','书中依然有一些与现实相反的令人愉悦惊叹的瞬间，这些时刻依旧是以一种同样的诙谐呈现的：床边的鬼魂、寄来的无名的身上带有咒语的娃娃、那个微不足道却最终导致乌尔比诺医生丧命的邪门的鹦鹉。然而作者的注意力和精力主要还是集中在那些与事实并不相悖的方面，即我们常说的“现实”，这其中爱与爱会灭亡的可能性是不可或缺的动力，而各种魔幻之事无非是在这扩展的视野中被精心利用的工具，它们更加成熟、阴暗却并不仁慈宽大。',0,NULL),(14,1427407024,'978-7-5442-5897-5','2016-06-13 18:23:04','<p>和古往今来所有最伟大的爱情颂歌一样，马尔克斯笔下的爱情具有永恒的意义。但是这种意义也是理想中的意义，它要和现实，和喀他赫纳的世界拼死对抗才能保护自己。             自从有了人类，有了爱情，残忍、偏狭、愚昧、背叛，和永无休止的琐碎就缠绕着它，就象缠绕着人类其他的最美最高贵的造物。杜拉斯借他的人物说，“相比你年轻时的美丽，我更爱你历尽沧桑的容颜。”</p> 无忧无虑的青春，它不知道那朵幸福的五瓣丁香，需要一生去寻找，去追逐，去浇灌，去呵护，从年轻到年老，永不能休止，永不能停息。因为，“世界上再没有比爱更艰难的事了。” ',0,'2016-06-13 18:39:36'),(15,1427407024,'978-7-5317-3115-3','2016-06-03 15:23:19','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更</p>',1,NULL),(16,1427407026,'978-7-5442-5897-5','2016-06-04 00:23:31','“糟糕的是，”叔叔对他说，“没有河运就没有爱。”对弗洛伦蒂诺来说，这恰巧就是事实：他的生命轨迹被两段里程碑式的河上航行所定型，这两段航行间隔了半个世纪之久。第一段航行中，他做了回到费尔明娜的城市并永久居住在那里的决定，第二段航行中，他穿越那荒凉的土地，与费尔明娜一起，开启了与时间对抗的爱之旅。我再没读过如此令人惊叹的结尾，它的节奏和活力如同交响乐一般，那种律动也像是一条在河里行驶的船。这篇章的作者，也是我们这次航程的导航员，用一生的经历指引着我们，毫不迷失地在那条我们都知道的河流之上航行，在怀疑与悲悯之间穿梭。如若没有在这条河上的航行，就没有爱情可言，而正是逆着这条河的水流，那奋力回归的努力才会值得尊重和铭记：这样航行的最好产物就是那些把我们破损不堪的灵魂归还给我们的作品，而这其中不可置疑地包括这部炫目且令人心碎的小说《霍乱时期的爱情》。',1,NULL),(17,1427407027,'978-7-5442-5897-5','2016-06-04 00:23:48','艾迪丝？格罗斯曼在翻译《霍乱时期的爱情》时特别注意了这一个原则，她十分敏感且充满想象力地迎合了作者多变的声音。我的西班牙语并不好，但是我能看出来她极好地不费吹灰之力地就跟上了马尔克斯写作的节奏，掌握了他写作的透明度，她传神地翻译了他用的俚语和高雅词汇，还有那些抒情的篇章和马尔克斯喜欢用来暗示我们的句末击中要害的话。',0,NULL),(18,1427407028,'978-7-5442-5897-5','2016-06-04 00:24:06','马尔克斯这位一本正经地说着荒诞故事的讲述者正是弗洛伦蒂诺的传记作者。如他所记录的那样，19岁那年，这位年轻的作者在阅读卡夫卡的《变形记》开篇最着名的段落的时候曾经灵光乍现，突然顿悟。那一段描写了一个男人醒来后发现自己变成了一只巨大的甲虫。“天哪，”马尔克斯惊呼，“这正是我祖母经常讲的故事啊！”他还说从那时起他就开始对小说充满了兴趣。他说在他那被称作“魔幻现实主义”的作品中存在的不过是她祖母讲故事的声音。',1,NULL),(19,1427407029,'978-7-5442-5897-5','2016-06-04 00:24:23','可以说，这是唯一的诚实地书写爱情的方法：当然没有阴暗面和有限性，这个故事也可以集浪漫爱情、情欲、社会喜剧、肥皂剧于一身，但是却不能真正地体现那个大写的“爱”字。这除了需要有一个有利的视角和一定程度的理解之外，似乎还需要作者能控制自己对笔下人物的爱，向读者隐藏他所关注的全部内容，换句话就是说作者千万不能沦落到说胡话的境地。',1,NULL),(20,1427407024,'978-7-5538-0159-9','2016-06-04 17:33:09','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更</p>',1,NULL),(21,1427407025,'978-7-5063-7077-6','2016-06-05 00:03:26','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更</p>',1,NULL),(28,1427407024,'978-7-5538-0157-5','2016-06-05 13:04:54','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更</p>',1,NULL),(29,1427407024,'978-7-02-009866-8','2016-06-05 13:05:04','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更</p>',1,NULL),(30,1427407024,'978-7-101-09634-7','2016-06-05 13:08:11','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更</p>',0,'2016-06-13 11:47:56'),(31,1427407024,'978-7-208-10376-4','2016-06-05 13:09:50','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣看新晴 古今多少事 漁唱起三更</p>',1,NULL),(32,1427407016,'978-7-208-10376-4','2016-06-05 15:06:04','<p>臨江仙·夜登小閣億洛中舊游 </p><p>宋 ·陳與義</p><p>憶昔午橋橋上飲 座中多是豪傑 長溝流月去無聲 杏花疏影里 吹笛到天明</p><p> 二十馀年如一夢 此身雖在堪驚 閑登小閣